import React from 'react';
import { useParams } from 'react-router-dom';

export type UserProps = {
    name: string;
}


export const User = (props:UserProps) =>{
    const {params} = useParams();

    return(
        <div>
            User
            Name: {props.user.name}
            Cos
        </div>
    )
}
